import { Box } from "@mui/system";
import React from "react";

const Profile = ({ account }) => {
  return (
    <>
      <Box>
        <Typography style={{ marginTop: 2 }}>{account}</Typography>
      </Box>
    </>
  );
};

export default Profile;
